import React from 'react';
import './AboutContent.css';

function AboutContent() {
  return (
    <section className="about">
      <article className="resume">
        <p>
          Na Manjuba, acreditamos que a tecnologia deve ser acessível, transparente e ética. Somos uma empresa de desenvolvimento de software comprometida em resolver problemas digitais de maneira responsável e criativa. Estamos aqui para criar soluções que melhoram a vida das pessoas e das empresas.
        </p>
        <br />
        <p>
          Nossa missão é democratizar o acesso à tecnologia, simplificando processos e entregando soluções personalizadas para cada cliente. Nós nos esforçamos para construir relações duradouras, baseadas na confiança, transparência e colaboração.
        </p>
        <br />
        <p>
          Acreditamos que a inovação é essencial para alcançar nossos objetivos, mas também valorizamos a tradição e a história da nossa região. Buscamos preservar o patrimônio natural e cultural do Piauí, trabalhando em harmonia com a comunidade e apoiando iniciativas de desenvolvimento sustentável.
        </p>
        <br />
        <p>
          Nosso objetivo é ser uma referência em desenvolvimento de software ético e responsável, reconhecidos pela qualidade de nossas soluções e pela excelência de nosso atendimento. Na Manjuba, estamos comprometidos em construir um futuro melhor para todos, e estamos prontos para enfrentar os desafios do presente e do futuro.
        </p>
      </article>
    </section>
  );
}

export default AboutContent;
